import { useDispatch } from "react-redux";
import { useNavigate } from "../Hooks/use-navigate-to";

function Link({to, children})
{
   const handleClick = (event) =>
   {
       event.preventDefault();
       useNavigate(to);
   }

   return <div>
       <a onClick={handleClick}>{children}</a>
   </div>
}

export default Link;
